function Login() {
	return (
		<div className='relative h-screen w-screen mt-14  z-10 '>
			<img
				src='https://images.unsplash.com/photo-1587829741301-dc798b83add3?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=2365&q=80'
				alt=''
				className='w-full h-full filter  blur-sm'
			/>
		</div>
	);
}

export default Login;
